import React, { useState } from "react";
import { Link } from "react-router-dom";
import Defi from "./Defi";
import Exchnage from "./Exchnage";
import Favorites from "./Favorites";
import Heatmap from "./Heatmap";
import Tabledata from "./Tabledata";

const Shifting = () => {
  const [val, setval] = useState("cryp");
  const renfun = (ab) => {
    setval(ab);
  };
  return (
    <div>
      <div className={`${classes.disp} conta`} style={{ padding: "0 80px" }}>
        <div className="row">
          <div className="col-2" onClick={() => renfun("cryp")}>
            CRYPTOCURRENCIES
          </div>
          <div className="col-1" onClick={() => renfun("exch")}>
            Exchanges
          </div>
          <div className="col-1" onClick={() => renfun("fav")}>
            FAVORITES
          </div>
          <div className="col-1" onClick={() => renfun("defi")}>
            DEFI
          </div>
          <div className="col-1" onClick={() => renfun("heat")}>
            HEATMAP
          </div>
        </div>
      </div>
      <div>
        {val === "cryp" && <Tabledata/>}
        {val === "exch" && <Exchnage/>}
        {val === "fav" && <Favorites/>}
        {val === "defi" && <Defi/>}
        {val === "heat" && <Heatmap/>}
        {/* {val === "cryp" && <tyytf></tyytf>} */}
      </div>
    </div>
  );
};

export default Shifting;
